// frontend/src/components/EmailModal.js

import React, { useState } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  Typography
} from '@mui/material';

// Confirmation dialog component
function ConfirmDialog({ open, onClose, onConfirm, count }) {
  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Confirm Send Email</DialogTitle>
      <DialogContent>
        <Typography>
          Are you sure you want to send this email to {count} {count === 1 ? 'person' : 'people'}?
        </Typography>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>No</Button>
        <Button onClick={onConfirm} variant="contained" color="primary">
          Yes
        </Button>
      </DialogActions>
    </Dialog>
  );
}

// Success dialog component
function SuccessDialog({ open, onClose, count }) {
  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Email Sent</DialogTitle>
      <DialogContent>
        <Typography>
          Email sent to {count} {count === 1 ? 'person' : 'people'}.
        </Typography>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} variant="contained" color="primary">
          OK
        </Button>
      </DialogActions>
    </Dialog>
  );
}

function EmailModal({ emailData, onClose }) {
  // Calculate the recipient count.
  const recipientsCount =
    typeof emailData.recipients === 'number'
      ? emailData.recipients
      : Array.isArray(emailData.recipients)
      ? emailData.recipients.length
      : 0;

  const [subject, setSubject] = useState(emailData.subject || '');
  const [message, setMessage] = useState('');

  const [confirmOpen, setConfirmOpen] = useState(false);
  const [successOpen, setSuccessOpen] = useState(false);

  // When the "Send Email" button is clicked in the modal, open the confirmation dialog.
  const handleSendClick = () => {
    setConfirmOpen(true);
  };

  // When confirmed, close the confirmation and open the success dialog.
  const handleConfirm = () => {
    setConfirmOpen(false);
    // In a real implementation, you'd send the email here.
    setSuccessOpen(true);
  };

  // When the success dialog closes, close the entire EmailModal.
  const handleSuccessClose = () => {
    setSuccessOpen(false);
    onClose();
  };

  return (
    <>
      <Dialog open onClose={onClose}>
        <DialogTitle>Send Email</DialogTitle>
        <DialogContent>
          <Typography variant="body1" gutterBottom>
            {`You are about to send an email to ${recipientsCount} ${recipientsCount === 1 ? 'person' : 'people'}.`}
          </Typography>
          <TextField
            margin="dense"
            label="Subject"
            fullWidth
            variant="outlined"
            value={subject}
            onChange={(e) => setSubject(e.target.value)}
          />
          <TextField
            margin="dense"
            label="Message"
            fullWidth
            multiline
            rows={4}
            variant="outlined"
            value={message}
            onChange={(e) => setMessage(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={onClose}>Cancel</Button>
          <Button onClick={handleSendClick} variant="contained" color="primary">
            Send Email
          </Button>
        </DialogActions>
      </Dialog>

      <ConfirmDialog
        open={confirmOpen}
        onClose={() => setConfirmOpen(false)}
        onConfirm={handleConfirm}
        count={recipientsCount}
      />

      <SuccessDialog
        open={successOpen}
        onClose={handleSuccessClose}
        count={recipientsCount}
      />
    </>
  );
}

export default EmailModal;
